import React from 'react'
import axios from 'axios'
// import 'bulma/css/bulma.css'
import NavbarOther from '../../components/Navbar/NavbarOther'
import Banner from '../../components/Banner'
import { connect } from 'react-redux'
import { loadData, setSignedIn, setViewer } from '../../actions'
import Content from '../../components/Content'
import Footer from '../../components/Footer'


const City = ({ loadData, match, setSignedIn, setViewer }) => {
    axios.get('/users').then(res => {
        setSignedIn(res.data)
        setViewer(res.data)
    }).catch(err => alert(err))
    axios.get(`/globeData/${match.params.id}`).then(res => {
        loadData(res.data, 'CITY')
    }).catch(err => alert(err))
    return (<div>
        <NavbarOther />
        <Banner />
        <Content />
        <Footer />
    </div>)
}

const mapDispatchToProps = dispatch => {
    return {
        setSignedIn: (id) => dispatch(setSignedIn(id)),
        loadData: (id, label) => dispatch(loadData(id, label)),
        setViewer: id => dispatch(setViewer(id))
    }
}

export default connect(null, mapDispatchToProps)(City)
